	li $s2,0
	la $s3,X
	la $s4,Y
while_mapa:
	beq $s2,$s4,exit_map	
	beq $s1,$s3,reseta_x
	move $a0,$s1
	move $a1,$s2
	lbu $a2,0($s0)
	jal PONTO
	addi $s1,$s1,1
	addi $s0,$s0,1
	j while_mapa
reseta_x:
	li $s1,0
	addi $s2,$s2,1
	j while_mapa
exit_map:
	lw $ra,0($sp)
	addi $sp,$sp,4
	jr $ra

# $a0 = xcentro	$a1 = ycentro $a3 = endereco_inicio_desenho	
PRINT_DESENHO:
	addi $sp,$sp,-28
	sw $ra,24($sp)
	sw $s0,20($sp)
	sw $s1,16($sp)
	sw $s2,12($sp)
	sw $s3,8($sp)
	sw $s4,4($sp)
	sw $s5,0($sp)
	
	move $s0,$a3
	subi $s1,$a0,5 # $s1 = xc - 5
	subi $s2,$a1,5 # $s2 = yc - 5
	addi $s3,$a0,5 # $s3 = xc + 5
	addi $s4,$a1,5 # $s4 = yc + 5
	move $s5,$s1
while_desenho:
	beq $s2,$s4,exit_desenho	
	beq $s1,$s3,reseta_x_desenho
	move $a0,$s1
	move $a1,$s2
	lbu $a2,0($s0)
	jal PONTO
	addi $s1,$s1,1
	addi $s0,$s0,1
	j while_desenho
reseta_x_desenho:
	move $s1,$s5 # restaura x 
	addi $s2,$s2,1
	j while_desenho
exit_desenho:
	lw $ra,24($sp)
	lw $s0,20($sp)
	lw $s1,16($sp)
	lw $s2,12($sp)
	lw $s3,8($sp)
	lw $s4,4($sp)
	lw $s5,0($sp)
	addi $sp,$sp,28
	jr $ra

#$a0 = x, $a1 =y , $a2 = cor	
PONTO: 	la $t0, VGA_BASE
	la $t2, X
	la $t3, Y
	slt $t4,$a0,$t2 # a0 < $t2(X)
	beqz $t4,ponto_fora_limite
	slt $t4,$a1,$t3 # a1 < $t3(Y)
	beqz $t4,ponto_fora_limite
	mul $t1, $a1, $t2 # $t1 = $a1(y) * 320; 
	add $t1, $t1, $a0 # $t1 = $t1($a1(y) * 320) + $a0(x); 
	add $t0, $t0, $t1 # $t0 = 0xFF000000 + y * 320 + x
	sb $a2, 0($t0) # salva $a2 (cor) no byte que $t0 corresponde.
	addi $v0,$zero,0
	jr $ra
ponto_fora_limite:
	addi $v0,$zero,4 # x ou y esto fora do limite
	la $a0, ERRO_PONTO
	syscall
	jr $ra
	
START:
loop1:
	mtc0 $t0, $8 # Reinicia Contador	
	lw $a0, 0xffff0000 # Busca se h interrupo no teclado
	andi $a0, $a0, 0x1 # verificando o bit ready
    	addi $t0,$zero -1 # Decrementa o contado do clico
    	bnez $a0, check_key # se h interrupo no teclado
    	bnez $t0, loop1
    	
check_key:
    mtc0 $0, $9
 
# $a0 = xc $a1 = yc	     
 loop:
 	addi $sp,$sp,-16
	sw $ra,12($sp)
	sw $s0,8($sp)
	sw $s1,4($sp)
 	sw $s2,0($sp)
 	move $s1,$a0
 	move $s2,$a1
 	li $s0,15
 loop2:
	la $a3,pac_man_aberta_direita
	jal PRINT_DESENHO
	li $a0,50
	li $v0,32
	syscall
	move $a0,$s1
	move $a1,$s2
	la $a3,quadrado_preto # reset quadrado
	jal PRINT_DESENHO
	li $a0,5
	li $v0,32
	syscall
	addi $s1,$s1,5
	move $a0,$s1
	move $a1,$s2
	la $a3,pac_man_fechado_horizontal 
	jal PRINT_DESENHO
	li $a0,50
	li $v0,32
	syscall
	move $a0,$s1
	move $a1,$s2
	la $a3,quadrado_preto # reset quadrado
	jal PRINT_DESENHO
	li $a0,50
	li $v0,32
	syscall
	beqz $s0,exit_loop
	addi $s0,$s0,-1
	addi $s1,$s1,5
	move $a0,$s1
	move $a1,$s2
	j loop2
exit_loop:
	addi $s1,$s1,5
	move $a0,$s1
	move $a1,$s2
	la $a3,pac_man_aberta_direita
	jal PRINT_DESENHO
	li $a0,50
	li $v0,32
	syscall
	lw $ra,12($sp)
	lw $s0,8($sp)
	lw $s1,4($sp)
	lw $s2,0($sp)
	addi $sp,$sp,16
	jr $ra
	
	
